import React from "react";
import "./carcard.css";


function CarCard() {

    return (
        <div className="main-car-card">
            <p className="Marca">VW - VolksWagen</p>
            <p className="Modelo">AMAROK High.CD 2.0 16V TDI 4x4 Dies. Aut</p>
            <p className="AnoModelo">2014</p>
            <p className="Fipe">R$ 108.966,00</p>
        </div>
    )
}
export default CarCard;
